import React from "react";
import styled from "styled-components";
import {Icon} from 'semantic-ui-react';
import {FaUser} from "react-icons/fa";
import {FaInstagram} from "react-icons/fa";
import {FaJava} from "react-icons/fa";
import {FaGithub} from "react-icons/fa";
import {FaIcons} from "react-icons/fa";
const ButtonST=styled.div`
    padding:30px;
    background-color:#fff;
    border-radius:10px;
    border:3px solid ${props => props.color};
    transition:all .3s;
    position:relative;
    color:${props => props.color};
    cursor:pointer;
    &:hover{
        transform:scale(1.1);
    }
    span{
        position:absolute;
       bottom:10%;
       left:50%;
       transform:translateX(-50%);
        }


`;
class MenuButtonGithub extends React.Component{
    render(){
        return <ButtonST color={this.props.color}>
                <FaGithub style={{fontSize:"30px"}}></FaGithub>
                <br></br>

                <span><a href="https://www.naver.com">this.props.text}</a></span>
               </ButtonST>;
    }
}



export default MenuButtonGithub;
